import React from "react";
import { Card } from "semantic-ui-react";

export default function CarData(props) {
  const { cars } = props;
  return cars.map((car, id) => {
    return (
      <Card >
        <Card.Content inverted>

        <Card.Header>{car.plate}</Card.Header>
        <Card.Description>
          <p >Address</p>
          <p>{car.address}</p>
        </Card.Description>
        </Card.Content>
      </Card>
    );
  });
}
